import Vue from 'vue'
import Router from 'vue-router'
import login from "../views/login/Login.vue";
import success from "../views/login/Success.vue";
import error from "@/views/login/Error.vue";

Vue.use(Router)

export default new Router({
  routes: [
    {
      path: '/',
      name: 'Login',
      component: login
    },
    {
      path: '/Success',
      name: '登录成功',
      component: success
    },
    {
      path: '/Error',
      name: 'error',
      component: error
    }
  ]
})
